function multiDimensionalArrayIndex(dimensions, indices) {
  var l = dimensions.length - 1
    , index = indices[l]
    , factor

  if (dimensions.length > 1) {
    factor = dimensions[l - 1]

    index += factor * indices[l - 1]
  }

  for (var i = 2; i < dimensions.length; i++) {
